import "../CSS/App.css";
import { AdvancedChart } from "react-tradingview-embed";

function App() {
    return (
        <div className="Home">
            <div className="winrate"></div>
            <div className="details"></div>
            <div className="chart">
                <AdvancedChart
                    className="chart"
                    widgetProps={{ ticker: "aapl", theme: "dark" }}
                />
            </div>
            <div className="positions"></div>
        </div>
    );
}

export default App;
